import React from "react";
import { useState } from "react";
import '../css/ProjectList.css'
import {ReactComponent  as  GitHubLogo} from './github.svg';




const ProjectList = ()=>{
    const [p1SlideIndex,setP1SlideIndex] = useState(0);
    const [p2SlideIndex,setP2SlideIndex] = useState(0);

    const next = (id)=>{
        if(id===1){
            setP1SlideIndex((p1SlideIndex+1)%3);
        }else{
            setP2SlideIndex((p1SlideIndex+1)%2);
        }
    }
    const prev = (id)=>{
        if(id===1){
            let temp = p1SlideIndex-1;
            if(temp<0)
                temp+=3;

            setP1SlideIndex(temp%3);
        }
        if(id===2){
            let temp = p2SlideIndex-1;
            if(temp<0)
                temp+=2;

            setP2SlideIndex(temp%2);
        }
    }

    return(
        <div className="project-list" id="work">
            <h3><span>02.</span>Some Things I've Made</h3>
            <div className="container">
                <div className="project p1">
                    <div className='image-gallery'>
                        <div className="image-container">
                            <div className="slide" style={{display:(p1SlideIndex===0?'block':'none')}}>
                                <img src="/assert/project/p1.png"/>
                            </div>
                            <div className="slide" style={{display:(p1SlideIndex===1?'block':'none')}}>
                                <img src="/assert/project/p2.png"/>
                            </div>
                            <div className="slide" style={{display:(p1SlideIndex===2?'block':'none')}}>
                                <img src="/assert/project/p3.png"/>
                            </div>         
                            <a className="prev" onClick={()=>next(1)}>&#10094;</a>
                            <a className="next" onClick={()=>prev(1)}>&#10095;</a>

                        </div>

                        <div className='project-description'>
                            <h3>Featured Project</h3>
                            <h2>Google Analysis</h2>
                            <div className="project-feature">
                                <p >A Sentiment Analysis  and document classification for google group post</p>
                                <div className='technology'>
                                    <a href="https://github.com/allenwalker1106/GoogleAnalysis" target="_blank">
                                        <GitHubLogo className='social-logo'/>
                                    </a>
                                    <p>React Python Keras Mongodb</p>
                                </div>
                            </div>
                        </div>
                    </div>


                </div>
                <div className="project p2">
                    <div className='image-gallery'>
                        <div className="image-container">
                            <div className="slide" style={{display:(p2SlideIndex===0?'block':'none')}}>
                                <img src="/assert/project/p4.png"/>
                            </div>
                            <div className="slide" style={{display:(p2SlideIndex===1?'block':'none')}}>
                                <img src="/assert/project/p5.png"/>
                            </div>    
                            <a className="prev" onClick={()=>next(2)}>&#10094;</a>
                            <a className="next" onClick={()=>prev(2)}>&#10095;</a>

                        </div>

                        <div className='project-description'>
                            <h3>Featured Project</h3>
                            <h2>Google Analysis</h2>
                            <div className="project-feature">
                                <p >A Sentiment Analysis  and document classification for google group post</p>
                                <div className='technology'>
                                    <a href="https://github.com/allenwalker1106/GoogleAnalysis" target="_blank">
                                        <GitHubLogo className='social-logo'/>
                                    </a>
                                    <p>React Python Keras Mongodb</p>
                                </div>
                            </div>
                        </div>
                    </div>


                </div>
            </div>
        </div>
    );
}

export default ProjectList;
